import React from "react";

const Contact = () => {
    return (
        <div className="h-full w-full flex justify-center items-center">
            <div className="flex w-3/5 h-3/5 bg-gray-900 rounded-lg">
                <div className="w-1/2">
                    <p className="text-3xl">Laten we praten!</p>
                </div>
                <div className="w-1/2">

                </div>
            </div>
        </div>
    );
}

export default Contact;
